import config from "../../config/config";

const sequelize = new Sequelize(
  config.db_name,
    config.db_username,
    config.db_password,
    {
        dialect : 'postgres',
        pool : {
          min : 0,
          max : 5,
          acquire : 30000,
          idle : 1000,
        }
    }
) 

