  const report_product = _report_product(sequelize, DataTypes);
  const store = _store(sequelize, DataTypes);
  const store_account = _store_account(sequelize, DataTypes);
  const store_area = _store_area(sequelize, DataTypes);


  return {
    product,
    product_brand,
    report_product,
    store,
    store_account,
    store_area,
  };
}
